    return (

            <CursorContextProvider><Cursor /><span onClick={() => {navigator.clipboard.writeText(document.getElementById('contact-email').textContent)}} id="contact-email" className="contact-email">ellajuengst@gmail.com</span></CursorContextProvider>

    )
}
